import React from 'react';
import { View, Text } from 'react-native';

const HomeMap = (props) => {
    return (
        <View style={{ 
                height: 300, 
                backgroundColor: "#a0abff",
                justifyContent: 'center',
                alignItems: 'center'
            }}>
            <Text>I'm a map</Text>
        </View>
    )
}

export default HomeMap;
